// src/pages/About.js
import React from "react";

export default function About() {
  return (
    <section className="max-w-7xl mx-auto px-4 py-10 text-white">
      <h2 className="text-3xl font-bold mb-4">About TailTales</h2>
      <p className="mb-4">
        TailTales is a web application designed to provide information about various dog breeds. 
        Our aim is to help dog lovers find detailed information about their favorite breeds.
      </p>
      <p>
        The data is sourced from The Dog Api to ensure accuracy and comprehensiveness. 
        We hope you find this application useful and enjoyable.
      </p>
    </section>
  );
}
